import React from 'react'
import { withStyles } from "@material-ui/core/styles";
import { green } from "@material-ui/core/colors";
import Checkbox from "@material-ui/core/Checkbox";

export const CheckBox = props => {
    const AnimatedCheckbox = withStyles({
        root: {
          color: green[400],
          "&$checked": {
            color: green[600]
          }
        },
        checked: {}
      })(props => <Checkbox onClick={props.handleCheckChieldElement} color="default" {...props} />);
    return (
        <li>
        <div className="view">
          <AnimatedCheckbox checked={props.isChecked} value="checked" />
          <label>{props.value}</label>
        </div>
      </li>
    )
}

export default CheckBox
